import {NavLink} from "react-router-dom"
import styles from "./Card.module.css";

const Card = (props) => {
  return (
    <div className={styles.card}>
      <NavLink to='/detail'>
        {props.name && <h1>{props.name}</h1>}
        {props.image && <img src={props.image} alt={props.name} />}
      </NavLink>
      {props.diet && Array.isArray(props.diet) && (
        <h2>DIET: {diet.join(", ")}</h2>
      )}
    </div>
  );
}

export default Card
